import { Container, Grid } from "@mui/material";
import React from "react";
import { useTheme } from "@mui/material/styles";
import useMediaQuery from "@mui/material/useMediaQuery";
import { Box } from "@mui/system";

const Partners = () => {
  let deviceType;
  const theme = useTheme();
  const xs = useMediaQuery(theme.breakpoints.down("sm"));

  if (xs) {
    deviceType = "small";
  } else {
    deviceType = "big";
  }

  return (
    <div
      style={{
        backgroundColor: "#E8F1FF",
      }}
    >
      <Container
        sx={{
          padding: 4,
        }}
      >
        <div>
          <Grid container>
            <Grid
              item
              xs={6}
              sm={6}
              md={4}
              sx={{
                borderRightColor: "black",
                borderRightWidth: 1,
                borderRightStyle: "solid",
                borderBottomColor: "black",
                borderBottomWidth: 1,
                borderBottomStyle: "solid",
              }}
            >
              <Box padding={4}></Box>
            </Grid>
            <Grid
              item
              xs={6}
              sm={6}
              md={4}
              sx={
                deviceType !== "small"
                  ? {
                      borderRightColor: "black",
                      borderRightWidth: 1,
                      borderRightStyle: "solid",
                      borderBottomColor: "black",
                      borderBottomWidth: 1,
                      borderBottomStyle: "solid",
                    }
                  : {
                      borderBottomColor: "black",
                      borderBottomWidth: 1,
                      borderBottomStyle: "solid",
                    }
              }
            >
              <Box padding={4}></Box>
            </Grid>
            <Grid
              item
              xs={6}
              sm={6}
              md={4}
              sx={
                deviceType !== "small"
                  ? {
                      borderBottomColor: "black",
                      borderBottomWidth: 1,
                      borderBottomStyle: "solid",
                    }
                  : {
                      borderRightColor: "black",
                      borderRightWidth: 1,
                      borderRightStyle: "solid",
                      borderBottomColor: "black",
                      borderBottomWidth: 1,
                      borderBottomStyle: "solid",
                    }
              }
            >
              <Box padding={4}></Box>
            </Grid>
          </Grid>
        </div>
      </Container>
    </div>
  );
};

export default Partners;
